import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    { title: "Car Insurance1", amount: 294.67, date: new Date(2021, 2, 28) },
    { title: "Car Insurance2", amount: 294.67, date: new Date(2021, 2, 28) },
    { title: "Car Insurance3", amount: 294.67, date: new Date(2021, 2, 28) },
    { title: "Car Insurance4", amount: 294.67, date: new Date(2021, 2, 28) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
